def blue(text):
	blue_pattern = r'\033\[34m.*?\033\[0m'
	return bool(res.search(blue_pattern, text))

def red(text):
	red_pattern = r'\033\[31m.*?\033\[0m'
	return bool(res.search(red_pattern, text))

def yellow(text):
	yellow_pattern = r'\033\[33m.*?\033\[0m'
	return bool(res.search(yellow_pattern, text))

def recolor(text):
	return res.sub(r'\033\[[0-9;]*m', '', text)


